import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";
import './main.css'


function Main(props){
    let lgt=useNavigate();


function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token');
    lgt('/');

 }

    return(
        <div style={{backgroundColor:'white'}}>

< nav class="w3-sidebar w3-bar-block w3-small  w3-center">

<img src="/w3images/avatar_smoke.jpg" style={{width:"100%"}} />
<a href="#" class="w3-bar-item w3-button w3-padding-large w3-black">
  <i class="fa fa-home w3-xxlarge"></i>
  <p>HOME</p>
</a>
<a href="#about" class="w3-bar-item w3-button w3-padding-large w3-hover-black">
  <i class="fa fa-user w3-xxlarge"></i>
  <p>ABOUT</p>
</a>
<a href="#photos" class="w3-bar-item w3-button w3-padding-large w3-hover-black">
  <i class="fa fa-eye w3-xxlarge"></i>
  <p>PHOTOS</p>
</a>
<a href="" onClick={Logout} class="w3-bar-item w3-button w3-padding-large w3-hover-black">
  <i class="fa fa-envelope w3-xxlarge"></i>
  <p>Logout</p>
</a>
</nav>


<div class="w3-top w3-hide-large w3-hide-medium" id="myNavbar">
<div class="w3-bar w3-black w3-opacity w3-hover-opacity-off w3-center w3-small">
  <a href="#" class="w3-bar-item w3-button" style={{width:"25%"}}>HOME</a>
  <a href="#about" class="w3-bar-item w3-button" style={{width:"25%"}}>ABOUT</a>
  <a href="#photos" class="w3-bar-item w3-button" style={{width:"25%"}}>PHOTOS</a>
  <a href="#logout" onClick={Logout} class="w3-bar-item w3-button" style={{width:"25%"}}>Logout</a>
</div>
</div>
        </div>
    );
}

export default Main;
